import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import Sub from "./Sub";
import notes from "./notes";
var React=require("react");
function createnote(notes){
    return (<Sub ti={notes.title}
    con={notes.content} />);
}
function App(){
    return (<div>
        <Header></Header>
        <Note ></Note>
        notes.map(createnote);
         {/* <Sub ti={notes[0].title}
         con={notes[0].content} />
          <Sub ti={notes[1].title}
         con={notes[1].content} />
          <Sub ti={notes[2].title}
         con={notes[2].content} /> */}
        <Footer></Footer> 
    </div>);
}
export default App;
